import React from "react";

// reactstrap components
import {
  Button,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Container,
  Row,
  Col
} from "reactstrap";

// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import GenericHeader from "components/Headers/GenericHeader.js";
import DefaultFooter from "components/Footers/DefaultFooter.js";
import Contact from "components/General/Contact.js";

function LandingPage() {
  const headerImage = "url(" + require("assets/img/bg6.jpg") + ")";
  React.useEffect(() => {
    document.body.classList.add("landing-page");
    document.body.classList.add("sidebar-collapse");
    document.documentElement.classList.remove("nav-open");
    return function cleanup() {
      document.body.classList.remove("landing-page");
      document.body.classList.remove("sidebar-collapse");
    };
  });
  return (
    <>
      <ExamplesNavbar />
      <div className="wrapper">
        <GenericHeader image={headerImage} title="GB Holders" subtitle="Representantes de Obligacionistas"/>
        <div className="section section-about-us">
          <Container>
            <Row>
              <Col className="ml-auto mr-auto text-center" md="8">
                <h3 className="title">Representación de Obligacionistas</h3>
                <h5 className="text">
                  Gbholders es una firma de abogados basada en un concepto original que busca 
                  diferenciarse positivamente de la competencia, aportando un valor agregado a sus 
                  servicios y otorgando confianza a sus clientes, basándose en la calidad técnica 
                  jurídica, cultura de trabajo, calidad de servicio y adaptación al cambio.
                </h5>
              </Col>
            </Row>
            <div className="separator separator-primary"></div>
          </Container>
        </div>

          <Contact/>

        <DefaultFooter />
      </div>
    </>
  );
}

export default LandingPage;
